import logo from './logo.svg';
import './App.css';
import {Link} from "react-router-dom"
import server from "./component/server"

function App() {
  return (
    <div className="App">
      <ul></ul>
    <Link to="/">Beranda</Link>
    <Link to="/hari">hari</Link>
    <Link to="/belanja">belanja</Link>
    <server/>
    </div>
  );
}

export default App;
